import os
import PyPDF2
import tiktoken
from langchain_openai import AzureChatOpenAI
from flask import Flask, request, jsonify

from dotenv import load_dotenv

load_dotenv()


def _get_token_length(input_string, encoding_name='gpt-4'):
    encoding = tiktoken.encoding_for_model(encoding_name)
    tokens = encoding.encode(input_string)
    token_length = len(tokens)
    
    return token_length


def _setup_azure_client():
    model = os.environ["AZURE_OPENAI_DEPLOYMENT"]

    llm = AzureChatOpenAI(
        api_version="2024-05-01-preview",
        temperature=0,
        max_tokens=16000,
        timeout=None,
        max_retries=2,
        model=model,
    )

    return llm


def _lees_pdf(bestand):
    pdf_tekst = ""
    reader = PyPDF2.PdfReader(bestand)
    for pagina in reader.pages:
        tekst = pagina.extract_text()
        if tekst:
            pdf_tekst += tekst
    
    return pdf_tekst

# dummy method with the full b64 of a pdf just pasted in here, should certainly be replaced with an API call in the future
def _get_beheersbesluit():
    import base64
    import io

    b64_data = """"""
    file_bytes = base64.b64decode(b64_data)
    bestand = io.BytesIO(file_bytes)
    return bestand


def _relevante_artikels_prompt(pdf_tekst):
    return f"""Je bent een taalmodel dat de tekst van een uitgelezen PDF over een erfgoed ontvangt. 
        Jouw taak is om exact die delen van de tekst te selecteren die specifiek bespreken of er wel of niet wijzigingen 
        mogen worden aangebracht aan het erfgoed. Indien een bepaald artikel handelt over toegelaten wijzigingen, geef dat het volledige artikel mee.
        
        Hier is de pdf tekst:
        {pdf_tekst}"""


def _user_response_prompt(relevante_artikels, user_input):
    return f"""Jij bent een assistent die vragen beantwoordt over een document dat aanduidt welke aanpassingen er wel of niet mogen gemaakt
        worden aan een beschermd gebouw. INDIEN JE NIET KAN TERUGVINDEN, ANTWOORD JE DAT HET TOEGELATEN IS. De gebruiker zal een vraag stellen, en jij zal, gegeven de tekst van het besluit met de regels, of de aanpassing 
        al dan neit mag doorgevoerd worden. Het is heel belangrijk dat je ook de tekst citeert met passage en bijhorend artikelnummer. 
        INDIEN JE NIETS TOEPASSELIJK VINDT IN DE TEKST, HOEF JE NIETS TE CITEREN. LAAT DE GEBRUIKER WETEN DAN OOK WETEN DAT DE HANDELING IS TOEGESTAAN.

        VERNOEM HET BESTAAN VAN HET DOCUMENT OF DE TEKST OOK NIET.

        De document tekst is hier te vinden:
        {relevante_artikels}

        Vraag van de gebruiker:
        {user_input}"""


def get_llm_response(user_input):
    #set up client
    llm = _setup_azure_client()
    
    #dummy methode voor pdf beheersbeslissing ophalen (is in bytes)
    pdf_beheersbeslissing = _get_beheersbesluit()
    
    #lees pdf in, met een extra check voor document lengte
    pdf_tekst = _lees_pdf(pdf_beheersbeslissing)
    if _get_token_length(pdf_tekst) > 30000:
        return "Stel een andere vraag"
    
    #Haal relevante artikels uit beheersbesluit
    #NOTITIE: indien nodig kan je deze tussenstap makkelijk laten vallen door: relevante_artikels = pdf_tekst
    prompt = _relevante_artikels_prompt(pdf_tekst)
    relevante_artikels = llm.invoke(prompt).content
    
    #Krijg juiste user response
    prompt = _user_response_prompt(relevante_artikels, user_input)
    response = llm.invoke(prompt).content
    
    return response


def _get_llm_response(user_input):
    # Set up the Azure OpenAI client
    llm = _setup_azure_client()
    
    # Read the PDF file
    pdf_beheersbeslissing = _get_beheersbesluit()
    pdf_tekst = _lees_pdf(pdf_beheersbeslissing)
    
    # Check if the text is too long
    if _get_token_length(pdf_tekst) > 30000:
        return "Stel een andere vraag"
    
    # Extract relevant articles
    #prompt = _relevante_artikels_prompt(pdf_tekst)
    #relevante_artikels = llm.predict(prompt)
    relevante_artikels = pdf_tekst
    
    # Generate the user response
    prompt = _user_response_prompt(relevante_artikels, user_input)
    response = llm.predict(prompt)
    
    return response

# Initialize the Flask app
app = Flask(__name__)

@app.route('/get_response', methods=['POST'])
def get_response():
    data = request.get_json()
    user_input = data.get('user_input')

    if not user_input:
        return jsonify({'error': 'No user_input provided'}), 400

    response = _get_llm_response(user_input)

    return jsonify({'response': response})


if __name__ == '__main__':
    app.run(debug=True)
